// src/components/Spinner.js
import React from 'react';
import './Spinner.css';

function Spinner() {
    return (
        <div className="spinner-overlay">
            <div className="spinner">
                <div className="spinner-icon"></div>
                <div className="spinner-dots">
                    <span></span>
                    <span></span>
                </div>
            </div>
        </div>
    );
}

export default Spinner;
